one \"5555678\"\r\n    Then a confirmation message \"User account created successfully\" should be displayed\r\n\r\n  Scenario: Admin tries to add a user with an existing id\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"2\", the name \"Farah\", the address \" Nablus \", and the phone \"5555678\"\r\n    Then an error message \"ID already exists\" should be displayed\r\n\r\n  Scenario: Admin adds a new supplier\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"3\", the name \"Ali\", the address \" Jenin \", and the phone \"5559101\"\r\n    Then a confirmation message \"User account created successfully\" should be displayed\r\n\r\n  Scenario: Admin tries to add a supplier with an existing id\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"3\", the name \"Ali\", the address \" Jenin \", and the phone \"5559101\"\r\n    Then an error message \"ID already exists\" should be displayed\r\n\r\n#############################################update############################################\r\n   \r\n Scenario: Admin updates a  owner's details\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"1\" to update a store owner\r\n    And the admin updates the details to:\r\n      | Field     | Value          |\r\n      | Name      | Reem           |\r\n      | Address   | Ramallah       |\r\n      | Phone     | 5551235        |\r\n    Then a confirmation message \"User account updated successfully\" should be displayed\r\n\r\n  Scenario: Admin tries to update a  owner with a non-existing id\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"999\" to update a store owner\r\n    And the admin updates the details to:\r\n      | Field     | Value          |\r\n      | Name      | Reem           |\r\n      | Address   | Ramallah       |\r\n      | Phone     | 5551235        |\r\n    Then an error message \"ID does not exist\" should be displayed\r\n\r\n  Scenario: Admin updates a user's details\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"2\" to update a user\r\n    And the admin updates the details to:\r\n      | Field     | Value          |\r\n      | Name      | Farah B        |\r\n      | Address   | Hebron         |\r\n      | Phone     | 5555679        |\r\n    Then a confirmation message \"User account updated successfully\" should be displayed\r\n\r\n  Scenario: Admin tries to update a user with a non-existing id\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"999\" to update a user\r\n    And the admin updates the details to:\r\n      | Field     | Value          |\r\n      | Name      | Farah B        |\r\n      | Address   | Hebron         |\r\n      | Phone     | 5555679        |\r\n    Then an error message \"ID does not exist\" should be displayed\r\n\r\n  Scenario: Admin updates a supplier's details\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"3\" to update a supplier\r\n    And the admin updates the details to:\r\n      | Field     | Value          |\r\n      | Name      | Ali A          |\r\n      | Address   | Bethlehem      |\r\n      | Phone     | 5559102        |\r\n    Then a confirmation message \"User account updated successfully\" should be displayed\r\n\r\n  Scenario: Admin tries to update a supplier with a non-existing id\r\n    Given the admin is logged into the system\r\n    When the admin enters the id \"999\" to update a supplier\r\n    And the admin updates the details to:\r\n      | Field     | Value          |\r\n      | Name      | Ali A          |\r\n      | Address   | Bethlehem      |\r\n      | Phone     | 5559102        |\r\n    Then an error message \"ID does not exist\" should be displayed\r\n\r\n########################################delete#####################################################\r\n sends a message \"Special discount on sweets this week!\" to the user \"Farah\"\r\n    Then the user \"Farah\" should receive the message \"Special discount on sweets this week!\" from the store owner \"Reem\"\r\n\r\n  Scenario: Supplier sends a message to a store owner\r\n    Given the supplier \"Ali\" is logged in\r\n    And the store owner \"Reem\" is registered in the system\r\n    When the supplier sends a message \"New batch of ingredients available\" to the store owner \"Reem\"\r\n    Then the store owner \"Reem\" should receive the message \"New batch of ingredients available\" from the supplier \"Ali\"\r\n\r\n \r\n  Scenario: Supplier receives a notification for a special request via email\r\n    Given the supplier \"Ali\" is logged in\r\n    And the supplier has an email \"ali@gemail.com\"\r\n    When a special request \"Urgent need for sugar supply\" is made by a store owner\r\n    Then the supplier \"Ali\" should receive an email notification at \"ali@gemail.com\" with the subject \"Special Request Notification\" and the body \"Urgent need for sugar supply\"\r\n\r\n  Scenario: User receives a message from a store owner\r\n    Given the user \"Farah\" is logged in\r\n    And the store owner \"Reem\" is registered in the system\r\n    When the store owner sends a message \"Your order is ready for pickup\" to the user \"Farah\"\r\n    Then the user \"Farah\" should receive the message \"Your order is ready for pickup\" from the store owner \"Reem\"\r\n\r\n  Scenario: User receives a message from a supplier\r\n    Given the user \"Farah\" is logged in\r\n    And the supplier \"Ali\" is registered in the system\r\n    When the supplier sends a message \"New ingredients available\" to the user \"Farah\"\r\n    Then the user \"Farah\" should receive the message \"New ingredients available\" from the supplier \"Ali\"\r\n\r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n \r\n  Scenario: Manage account details and update business information\r\n    Given the store owner is logged into the system\r\n    When the store owner navigates to the \"Account Management\" section\r\n    And the store owner updates their business information with new details:\r\n      | Field            | Value              |\r\n      | Business Name    | Reem's Sweets      |\r\n      | Address          | Nablus Sweet Street |\r\n      | Contact Number   | 123-456-7890       |\r\n    Then a confirmation message \"Account details updated successfully\" should be displayed\r\n    \r\n    \r\n      Scenario: Supplier updates account details\r\n    Given the supplier \"Ali\" is logged in\r\n    And the supplier \"Ali\" has access to their account settings\r\n    When the supplier updates the contact email to \"ali@supplier.com\"\r\n    And the supplier updates the phone number to \"123-456-7890\"\r\n    Then the system should save the updated email \"ali@supplier.com\"\r\n    And the system should save the updated phone number \"123-456-7890\"\r\n    Then a confirmation message \"Account details updated successfully\" should be displayed\r\n    \r\n    \r\n    \r\n\r\n  Scenario: Store owner processes an order\r\n    Given the store owner \"Reem\" is logged in\r\n    And there is an order with status \"Pending\" from the user \"Farah\"\r\n    When the store owner marks the order as \"Processed\"\r\n    Then the system should update the order status to \"Processed\"\r\n    And the user \"Farah\" should receive a notification that their order has been processed\r\n\r\n  Scenario: Supplier tracks an order status\r\n    Given the supplier \"Ali\" is logged in\r\n    And there is an order with status \"Shipped\" from the store owner \"Reem\"\r\n    When the supplier views the order details\r\n    Then the system should display the order status as \"Shipped\"\r\n    And the supplier should be able to see the estimated delivery date\r\n\r\n  Scenario: Customer cancels an order\r\n    Given the user \"Farah\" is logged in\r\n    And there is an order with status \"Pending\"\r\n    When the user \"Farah\" cancels the order\r\n    Then the system should update the order status to \"Cancelled\"\r\n    And the store owner \"Reem\" should receive a notification that the order has been cancelled\r\n    \r\n    \r\n    ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/mohee/Desktop/sweet/use_cases/Store%20Owner/management.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Communication and Notification","description":"","children":[{"scenario":{"location":{"line":3,"column":3},"tags":[],"keyword":"Scenario","name":"Store owner sends a message to a user","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"the store owner \"Reem\" is logged in","id":"d48dda74-abcf-4b35-ab18-8db62e03c338"},{"location":{"line":5,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"the user \"Farah\" is registered in the system","id":"47690b88-ee48-4542-8882-8a4fd81b1dec"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"the store owner sends a message \"Special discount on sweets this week!\" to the user \"Farah\"","id":"83915491-214d-4adc-9ed0-fc923dde4ace"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"the user \"Farah\" should receive the message \"Special discount on sweets this week!\" from the store owner \"Reem\"","id":"2c5ccf6a-0a56-49ee-85fe-5207641ebaf9"}],"examples":[],"id":"a7dbb687-626f-4e21-9c20-e8187316f675"}},{"scenario":{"location":{"line":9,"column":3},"tags":[],"keyword":"Scenario","name":"Supplier sends a message to a store owner","description":"","steps":[{"location":{"line":10,"column":5},"keyword":"Given ","keywordType":"Context","text":"the supplier \"Ali\" is logged in","id":"d74eb22b-d618-4a8d-864b-a53c9e4698c1"},{"location":{"line":11,"column":5},"keyword":"And ","keywordType":"Conjuncti :/Users/mohee/Desktop/sweet/use_cases/User/Purchase.feature","data":"Feature: Beneficiary User Exploration and Purchase\r\n\r\n  Scenario: User browses and searches for dessert recipes\r\n    Given the user \"Farah\" is logged in\r\n    When the user navigates to the \"Recipes\" section\r\n    And the user searches for \"Chocolate Cake\"\r\n    Then the system should display a list of recipes related to \"Chocolate Cake\"\r\n\r\n  Scenario: User filters recipes based on dietary needs or food allergies\r\n    Given the user \"Farah\" is logged in\r\n    When the user navigates to the \"Recipes\" section\r\n    And the user applies a filter for \"Gluten-Free\"\r\n    Then the system should display only \"Gluten-Free\" recipes\r\n\r\n  Scenario: Purchase desserts directly from store owners\r\n    Given the user is on a store owner's page\r\n    When the user selects a dessert to purchase\r\n    And the user enters the payment details:\r\n      | Field        | Value              |\r\n      | Credit Card  | 1234-5678-9012-3456|\r\n      | Expiry Date  | 8/25              |\r\n      | CVV          | 123                |\r\n    And the user submits the payment\r\n    Then a confirmation message \"Purchase completed successfully\" should be displayed\r\n    And the user should receive an email receipt\r\n\r\n\r\n\r\n  Scenario: Directly communicate with store owners and suppliers for inquiries or assistance\r\n    Given the user is logged into the system\r\n    When the user navigates to the \"Contact\" section on a store owner's page\r\n    And the user sends a message \"I have a question about your chocolate cake recipe.\"\r\n    Then the message should be sent to the store owner\r\n    And a confirmation message \"Message sent successfully\" should be displayed\r\n\r\n  Scenario: Provide feedback on purchased products\r\n    Given the user is logged into the system\r\n    When the user navigates to the \"Order History\" section\r\n    And the user selects an order to pr
